import Link from "next/link";
import SocialLinks from "./SocialLinks";

const Nav = () => (
  <>
    <div className="wrapper">
      <Link href="/">
        <a className="navlink">HOME</a>
      </Link>
      <Link href="/about">
        <a className="navlink">ABOUT</a>
      </Link>
    </div>
    <SocialLinks className="social" />
    <style jsx>
      {`
        .wrapper {
          display: flex;
          flex-direction: column;
          height: 100px;
          justify-content: center;
          margin-left: 15px;
          position: fixed;
          text-align: center;
          top: 45vh;
          z-index: 1;
        }
        .navlink {
          font-size: 15px;
          font-weight: 900;
          text-decoration: none;
          margin: 70px 0;
          transform: rotate(-90deg);
          letter-spacing: 5px;
        }
        .navlink:visited {
          color: black;
        }
        .navlink:hover {
          opacity: 0.5;
        }
        .social {
          display: flex;
          flex-direction: row;
          position: fixed;
          top: 20px;
          right: 30px;
          z-index: 1;
        }
      `}
    </style>
  </>
);

export default Nav;
